import logo from './logo.svg';
import './App.css';
import Page from './pages/TheMansion.html';
var htmlDock = {__html: Page};

import Navbar from "./components/Navbar"
import { 
  BrowserRouter as Router,
  Routes,
  Route,
  BrowserRouter,
 } from 'react-router-dom';


function App() {
  return (
    <>
    <BrowserRouter>
      <Navbar/>
    </BrowserRouter>
      <Router>
        <Routes>
          <Route exact path="../pages/TheMansion.html" render={() => {window.location.href="TheMansion.html"}} />
        </Routes>
      </Router>



    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    </>
  );
}

export default App;


const container = {
  width: 500,
  margin: '50px auto'
}
